let ShowXAxisLabelInstance = null;
module.exports = class ShowXAxisLabel {

    constructor() {
        if (!ShowXAxisLabelInstance) {
            ShowXAxisLabelInstance = this;
            //set all other default values

            this.displayAs = 'Show X-Axis Label';
            this.value = '[showXAxisLabel]'
            this.type = 'TOGGLE';
            this.values = {'true-value':'true', 'false-value': 'false'}
        }
        return ShowXAxisLabelInstance;
    }
}
